function delay(t, v) {
	return new Promise(function(resolve) {
		setTimeout(resolve.bind(null, v), t)
	});
}

function QrCode(Status) {
	switch (Status) {
		case "ready":
			Console = "Reading Completed!";
			Data = "data:image/png;base64,";
			break
		case "authenticated":
			Console = "Whatsapp Authenticated Successfully!";
			Data = "data:image/png;base64,";
			break
		case "auth_failure":
			Console = "Authentication Failed, Restarting...";
			Data = "data:image/png;base64,";
			break
		case "disconnected":
			Console = " Whatsapp Has Been Disconnected!";
			Data = "data:image/png;base64,";
		default:
			Console = "Loading application";
			Data = "data:image/png;base64,";
	}
	return (Data + "##" + Console).split("##");
}

