const client = new Client({
	authStrategy: new LocalAuth({
		clientId: 'Bot-Mwsm'
	}),
	puppeteer: {
		headless: true,
		args: [
			'--no-sandbox',
			'--disable-setuid-sandbox',
			'--disable-dev-shm-usage',
			'--disable-accelerated-2d-canvas',
			'--no-first-run',
			'--no-zygote',
			'--single-process', // <- this one doesn't works in Windows
			'--disable-gpu'
		]
	}
});

var Status;
client.initialize();

io.on('connection', function(socket) {
	socket.emit('message', '> Bot-Mwsm : ' + QrCode(Status)[1]);
	socket.emit('qr', QrCode(Status)[0]);

	client.on('qr', (qr) => {
		qrcode.toDataURL(qr, (err, url) => {
			try {
				socket.emit('qr', url);
			} catch (err) {
				console.log('> Bot-Mwsm : ' + err);
			} finally {
				socket.emit('message', '> Bot-Mwsm : QRCode Received, Waiting to Read!');
				console.log('> Bot-Mwsm : QRCode Received, Waiting to Read!');

			}
		});

	});

	client.on('ready', () => {
		Status = "ready";
		socket.emit('message', '> Bot-Mwsm : ' + QrCode(Status)[1]);
		console.log('> Bot-Mwsm : ' + QrCode(Status)[1]);
		socket.emit('qr', QrCode(Status)[0]);
	});

	client.on('authenticated', () => {
		Status = "authenticated";
		socket.emit('message', '> Bot-Mwsm : ' + QrCode(Status)[1]);
		console.log('> Bot-Mwsm : ' + QrCode(Status)[1]);
		socket.emit('qr', QrCode(Status)[0]);
	});

	client.on('auth_failure', () => {
		Status = "auth_failure";
		socket.emit('message', '> Bot-Mwsm : ' + QrCode(Status)[1]);
		console.log('> Bot-Mwsm : ' + QrCode(Status)[1]);
		socket.emit('qr', QrCode(Status)[0]);
	});

	client.on('change_state', state => {
		Status = "change_state";
		console.log('> Bot-Mwsm : ' + state);
	});

	client.on('disconnected', (reason) => {
		Status = "disconnected";
		socket.emit('message', '> Bot-Mwsm : ' + QrCode(Status)[1]);
		console.log('> Bot-Mwsm : ' + QrCode(Status)[1]);
		socket.emit('qr', QrCode(Status)[0]);
		delay(5000).then(async function() {
			client.initialize();
		});
	});
});

// Send message
app.post('/send-message', [
	body('to').notEmpty(),
	body('msg').notEmpty(),
], async (req, res) => {
	const errors = validationResult(req).formatWith(({
		msg
	}) => {
		return msg;
	});

	if (!errors.isEmpty()) {
		return res.status(422).json({
			status: false,
			message: errors.mapped()
		});
	}

	const number = req.body.to;
	const numberDDI = number.substr(0, 2);
	const numberDDD = number.substr(2, 2);
	const numberUser = number.substr(-8, 8);
	const Mensagem = req.body.msg.replaceAll("\\n", "##").split("##");
	var WhatsApp = number + "@c.us";

	if (numberDDI === "55" && parseInt(numberDDD) <= 30) {
		WhatsApp = "55" + numberDDD + "9" + numberUser + "@c.us";
	} else if (numberDDI === "55" && parseInt(numberDDD) > 30) {
		WhatsApp = "55" + numberDDD + numberUser + "@c.us";
	}

	if (WhatsApp == Wait || Wait == undefined) {
		Delay = 300;
	} else {
		Delay = sendwait;
	}

	setTimeout(function() {
		Mensagem.some(function(Send, index) {
			setTimeout(function() {
				client.sendMessage(WhatsApp, Send).then(response => {
					Wait = WhatsApp;
					res.status(200).json({
						status: true,
						message: 'Bot-Mwsm : Message Sent',
						response: response
					});
				}).catch(err => {
					return true;
					res.status(500).json({
						status: false,
						message: 'Bot-Mwsm : Message was not Sent',
						response: err.text
					});
				});
			}, index * interval);
		});
	}, Delay + Math.floor(Math.random() * 1000));

});


client.on('message', async msg => {

	const nomeContato = msg._data.notifyName;
	let groupChat = await msg.getChat();

	if (msg.type.toLowerCase() == "e2e_notification") return null;
	if (msg.body == "") return null;
	if (msg.from.includes("@g.us")) return null;

	if (msg.body !== null || msg.body === "0" || msg.type === 'ptt' || msg.hasMedia) {
		msg.reply("WhatsApp exclusivo para uso do sistema");
	}
});

